import { SET_INVOICE_INIT_STATE, CHANGE_INVOICE_COLOR } from './types';

export const setInvoiceInitState = (invoice) => (dispatch) => {
    dispatch({
        type: SET_INVOICE_INIT_STATE,
        payload: invoice,
    });
};
export const changeInvoiceColor = (color) => (dispatch) => {
    dispatch({
        type: SET_INVOICE_INIT_STATE,
        color,
    });
};
